import React from 'react';
import { Link } from 'react-router-dom';

const AdminPage = () => {
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-lightOliveGreen p-6">
      <h1 className="text-2xl font-bold text-darkGreen mb-6">Admin Dashboard</h1>
      
      <div className="space-y-4">
        <Link to="/add-freight-agent">
          <button className="bg-mediumGreen text-white py-3 px-6 rounded-md text-lg hover:bg-darkGreen transition">
            Add Freight Agent
          </button>
        </Link>
        
        <Link to="/add-freight-coordinator">
          <button className="bg-mediumGreen text-white py-3 px-6 rounded-md text-lg hover:bg-darkGreen transition">
            Add Freight Coordinator
          </button>
        </Link>
        
        <Link to="/add-main-user">
          <button className="bg-mediumGreen text-white py-3 px-6 rounded-md text-lg hover:bg-darkGreen transition">
            Add Main User
          </button>
        </Link>
      </div>
    </div>
  );
};

export default AdminPage;
